import SideBar from "./Sidebar";



const EmailList = () => {

    const dispatch = useDispatch();
    const alert = useAlert();
    const { error, emails } = useSelector((state) => state.emails);

    const { error: deleteError, isDeleted } = useSelector(
        (state) => state.email
    );

