            minWidth: 350,
            flex: 1,

            renderCell: () => {
                return (
                    <div>
                        <Fragment>
                            <Link to={`/admin/emails`} />
                        </Fragment>
                    </div>
                )
            }
        },

    ]

}

export default EmailList
